import hashlib  
import pickle  

md5_hash_table = {}  
for i in range(26 ** 4):  
    perm = ''  
    for j in range(4):  
        perm += chr(65 + (i // (26 ** j)) % 26)  
    md5_hash_table[hashlib.md5(perm.encode('utf-8')).hexdigest()] = perm  

with open("hash_table.pkl", "wb") as f:  
    pickle.dump(md5_hash_table, f)
